import React from 'react';
import { useLocation } from 'react-router-dom'; // useLocation 추가

function Result() {
  const location = useLocation(); // useLocation을 이용해 location을 받아옵니다.
  const totalScore = location.state.totalScore; // 점수를 가져옴

  return (
    <div>
      <h1>결과</h1>
      <p>총 점수: {totalScore}</p>
    </div>
  );
}

export default Result;
